        public static List<ATObject>? ToATObjectList(this CBORObject obj)
        {
            if (obj == null)
            {
                return null;
            }

            var list = new List<ATObject>();
            foreach (var item in obj.Values)
            {
                list.Add(item.ToATObject());
            }
            return list;
        }
